export default class BookService {
  constructor() {
    this.books = [
      {
        id: '1',
        title: 'Production-Ready Microservices',
        author: 'Susan J. Fowler',
      },
      {
        id: '2',
        title: 'Release It!',
        author: 'Michael T. Nygard',
      }
    ];
    this.getAll = () => {
      return this.books;
    }
  }
}
